import React, { Component } from 'react';

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <p>
          Les tutos
          {' '}
          <span className="Semi-bold-Italic">League of Legends</span>
          {' '}
          sont maintenant disponibles sur Up&Win
        </p>
        <button type="button" className="Button">
          Go !
        </button>
      </div>
    );
  }
}

export default Home;
